__NUXT_JSONP__("/drugs/Gandotinib", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1229236-86-5",chebiId:b,chemicalFormula:b,definition:"An orally bioavailable imidazopyridazine and inhibitor of Janus kinase 2 mutant V617F (JAK2V617F), with potential antineoplastic activity. Upon oral administration, gandotinib selectively and competitively inhibits the activation of JAK2V617F, which may result in the inhibition of the JAK-STAT signaling pathway and the induction of apoptosis in JAK2V617F-expressing tumor cells. JAK2V617F has a substitution of phenylalanine for valine at amino acid position 617 and plays a key role in tumor cell proliferation and survival.",fdaUniiCode:"ANC71R916O",identifier:"C116857",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C129825","C1967"],synonyms:["3-(4-Chloro-2-fluorobenzyl)-2-methyl-N-(5-methyl-1H-pyrazol-3-yl)-8-(Morpholinomethyl)imidazo(1,2-b)pyridazin-6-amine","GANDOTINIB",a,"LY 2784544","LY2784544"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FGandotinib",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Gandotinib","","2021-10-30T13:19:18.623Z")));